function Menu:SetVisible(visible)
	Menu.Cursor[1].Visible = visible
	Menu.Cursor[2].Visible = visible
	for window_name, window_val in pairs(Menu.windows) do
		for k, v in ipairs(window_val.bbmenu) do
			v.Visible = visible
		end
		for k, v in pairs(window_val.drawing.tabs) do
			for k1, v1 in pairs(v.content) do
				v1.Visible = visible
			end
		end
	end
end

function Menu:SetOpacity(transparency)
	local opacity = transparency/255
	Menu.Cursor[1].Opacity = opacity
	Menu.Cursor[2].Opacity = opacity

	for window_name, window_val in pairs(Menu.windows) do
		for k, v in pairs(window_val.bbmenu) do
			if v.ColorUpperLeft == nil then
				v.Opacity = opacity
				if v.Outlined then
					v.OutlineOpacity = opacity
				end
			end
		end
		for k, v in pairs(window_val.drawing.tabs) do
			for k1, v1 in pairs(v.content) do
				if v1.ColorUpperLeft == nil then
					v1.Opacity = opacity
					if v1.Outlined then
						v1.OutlineOpacity = opacity 
					end
				end
			end
		end
		for k, v in pairs(window_val.customopacity) do
			v[1].OpacityUpperLeft = v[2]
			v[1].OpacityUpperRight = v[2]
	
			v[1].OpacityBottomLeft = v[3]
			v[1].OpacityBottomRight = v[3]
		end
	end
end

function Menu:SetAllActiveTab()
	for k, v in pairs(self.windows) do
		v:SetActiveTab(v.activetab)
	end
end

function Menu:SetSelectedWindow(window)
	local tabbie = Menu.windows[window]

	local newtable = {}
	for i, v in ipairs(self.window_order) do
		if v ~= window then
			table.insert(newtable, v)
		end
	end
	table.insert(newtable, window)
	self.window_order = newtable 

	
	for g_index, windowname in ipairs(self.window_order) do
		local curwindow = Menu.windows[windowname]

		local indexadd = 10 * g_index - 10
		for zindex, menuobjs in ipairs(curwindow.zindexs) do
			
			local setindex = indexadd + zindex
			for i, obj in ipairs(menuobjs) do
				obj.ZIndex = setindex
			end
		end
	end

	self.selected_window = window
	self.Curmenu = tabbie
end

function Menu:SetElement(element, value)
	if element.type == TOGGLE then
		if value then
			for i = 1, 4 do
				element.drawn[i].Color = ColorRange(i, {
					[1] = { start = 0, color = RGB(unpack(Menu.mc)) },
					[2] = { start = 3, color = RGB(addunpack(Menu.mc, -40)) },
				})
			end
		else
			for i = 1, 4 do
				element.drawn[i].Color = ColorRange(i, {
					[1] = { start = 0, color = RGB(50, 50, 50) },
					[2] = { start = 3, color = RGB(30, 30, 30) },
				})
			end
		end
	elseif element.type == SLIDER then
		local decplaces = element.decimal and string.rep("0", math.log(1 / element.decimal) / math.log(10))

		element.drawn[5].Text = element.custom[value] or (value == math.floor(value) and element.decimal) and tostring(value).. ".".. decplaces.. element.stradd or tostring(value).. element.stradd

		for i = 1, 4 do
			element.drawn[i].Size = Vec2((element.hitbox.w - 4) * ( (value - element.minvalue) / (element.maxvalue - element.minvalue) ), 2)
		end
	end
end

function Menu:CreateConnection(signal, name, func)
	assert(self.connections[name] == nil, "A menu connection by the name of \"".. name.. "\" already exists")
	self.connections[name] = signal:Connect(func)
end

function Menu:Unload()
	for k, conn in next, self.connections do
		if not getrawmetatable(conn) then
			conn()
		else
			conn:Disconnect()
		end
		self.connections[k] = nil
	end

	Draw:UnRender()
	
	Menu = nil 
	mDraw = nil
	Draw = nil
end

