function Menu.Funcs:MouseButton1Down() --ANCHOR MOUSE 1 INPUT 
	if Menu.Curmenu:MouseInsideMenu() then
		if not Menu.Curmenu:MouseInMenuCenter() then
			Menu.Curmenu.clickspot = Vec2(Menu.Curmenu.pos.x - LOCAL_MOUSE.x, Menu.Curmenu.pos.y - (LOCAL_MOUSE.y - 36))
			Menu.Curmenu.dragging = true
			return
		end

		for tab_num, tab in ipairs(Menu.Curmenu.hitboxes) do
			local pos = tab.main.pos
			local size = tab.main.size 
			if Menu.Curmenu:MouseInMenu(pos.x, pos.y, size.x, size.y) then
				if Menu.Curmenu.activetab ~= tab_num then
					Menu.Curmenu:SetActiveTab(tab_num)
				end
				return
			end
		end

		for group_box, gb_val in pairs(Menu.Curmenu.hitboxes[Menu.Curmenu.activetab].content) do
			if gb_val.multigroup then
				if Menu.Curmenu:MouseInMenu(gb_val.props.click_pos.x, gb_val.props.click_pos.y, gb_val.props.click_pos.width, gb_val.props.click_pos.height) then
					if not gb_val.active then
						gb_val.active = true

						for index, name in pairs(gb_val.family) do
							if group_box ~= name then
								Menu.Curmenu.hitboxes[Menu.Curmenu.activetab].content[name].active = false
							end
						end
						Menu.Curmenu:SetActiveTab(Menu.Curmenu.activetab)

						return
					end
				end

			end
		end

		for group_box, group_box_content in pairs(Menu.Curmenu.values[Menu.Curmenu:GetTabName()]) do
			
			local gb_values = Menu.Curmenu.hitboxes[Menu.Curmenu.activetab].content[group_box]

			if gb_values.active and gb_values.visible then
				local offset = gb_values.pos
				for element_name, element in pairs(group_box_content) do

					if element.type == TOGGLE then
						if Menu.Curmenu:MouseInMenu(offset.x + element.hitbox.x, offset.y + element.hitbox.y, element.hitbox.w, element.hitbox.h) then
							element.value = not element.value
							Menu:SetElement(element, element.value)
							return
						end
					elseif element.type == SLIDER then
						if Menu.Curmenu:MouseInMenu(offset.x + element.hitbox.x, offset.y + element.hitbox.y, element.hitbox.w, element.hitbox.h) then
							print("start")
							Menu.ActiveSlider = {element = element, offset = offset}
						end
					elseif element.type == IMAGE_LAYOUT then
						for img_group, group_conts in pairs(element.hitboxes) do
							local hitbox = group_conts.hitbox

							if Menu.Curmenu:MouseInMenu(offset.x + hitbox.x, offset.y + hitbox.y + element.y_add, hitbox.w, hitbox.h) then
								if element.value ~= img_group then
									element.value = img_group
									
									for img_name, img_drawn in pairs(element.hitboxes) do
										img_drawn.drawn.Color = img_name == img_group and RGB(255, 255, 255) or RGB(150, 150, 150)
									end
									
									if element.event ~= nil then
										element.event(element.value)
									end
								end
							end

						end
					end
				end

			end

		end
		
	end
end

