	end
end

Menu:CreateConnection(INPUT_SERVICE.InputBegan, "menu input", function(input) --ANCHOR INPUT HANDLER
	if not Menu.fading then
		if input.KeyCode == Enum.KeyCode.Delete then
			Menu.ActiveSlider = nil
			if Menu.fading == false then
				Menu.fadestart = tick()
				Menu.fading = true
				Menu.Curmenu.dragging = false
				if Menu.open == false then
					Menu:SetVisible(true)
					Menu:SetAllActiveTab()
				end
			end
		end
	end
	if Menu.open and not Menu.fading and Menu.selected_window ~= nil then
		if input.UserInputType == Enum.UserInputType.MouseButton1 then	
			for window_index, window_name in ipairs(reverse_table(Menu.window_order)) do
				if Menu.windows[window_name]:MouseInsideMenu() then
					if window_name ~= Menu.selected_window then
						Menu:SetSelectedWindow(window_name)
					end
					break
				end
			end
			Menu.Funcs:MouseButton1Down()
		else
			Menu.Funcs:KeyPressed(input)
		end
	end
end)

Menu:CreateConnection(INPUT_SERVICE.InputEnded, "menu input ended", function(input)
	if input.UserInputType == Enum.UserInputType.MouseButton1 then
		Menu.Funcs:MouseButton1Up()
	end
end)

Menu:CreateConnection(game.RunService.RenderStepped, "menu render stepped", function(fdt) --ANCHOR MENU RENDER STEPPED
	if Menu.fading then
		if Menu.open then
			local timesincefade = tick() - Menu.fadestart
			local fade_amount = 255 - math.floor((timesincefade * 10) * 255)
			Menu:SetOpacity(fade_amount)
			if fade_amount <= 0 then
				Menu.open = false
				Menu.fading = false
				Menu:SetOpacity(0)
				Menu:SetVisible(false)
			end
		else

			local timesincefade = tick() - Menu.fadestart
			local fade_amount = math.floor((timesincefade * 10) * 255)
			Menu:SetOpacity(fade_amount)
			if fade_amount >= 255 then
				Menu.open = true
				Menu.fading = false
				Menu:SetOpacity(255)
			end
		end
	end

	if Menu.open and not Menu.fading and Menu.selected_window ~= nil then
		if Menu.Curmenu.dragging then
			if INPUT_SERVICE:IsMouseButtonPressed(Enum.UserInputType.MouseButton1) then
				Menu.Curmenu:SetPos(LOCAL_MOUSE.x + Menu.Curmenu.clickspot.x, (LOCAL_MOUSE.y - 36) + Menu.Curmenu.clickspot.y)
			else
				Menu.Curmenu.dragging = false
			end
		end

		if Menu.ActiveSlider ~= nil then
			local element = Menu.ActiveSlider.element
			local offset = Menu.ActiveSlider.offset

			local new_val = ( element.maxvalue - element.minvalue) * (LOCAL_MOUSE.x - Menu.Curmenu.pos.x - (offset.x + element.hitbox.x) ) / (element.hitbox.w - 2 ) --crazy math
			local normalized_val = clamp( ( not element.decimal and math.floor(new_val) or math.floor(new_val / element.decimal) * decimal ) + element.minvalue, element.minvalue, element.maxvalue)

			local decplaces = element.decimal and string.rep("0", math.log(1 / element.decimal) / math.log(10))
			if decplaces and math.abs(normalized_val) < v2.decimal then
				normalized_val = 0
			end

			element.value = normalized_val
			Menu:SetElement(element, normalized_val)
		end
	end

	if Menu.TabbedIn ~= iswindowactive() then
		SCREEN_SIZE = Camera.ViewportSize
		Menu.Curmenu.dragging = false
		Menu.ActiveSlider = nil
		Menu.TabbedIn = iswindowactive()
	end

end)

