	function curmenu:MouseInsideMenu()
		return (LOCAL_MOUSE.x > self.pos.x and LOCAL_MOUSE.x < self.pos.x + self.w and LOCAL_MOUSE.y > self.pos.y - 36 and LOCAL_MOUSE.y < self.pos.y + self.h  - 36)
	end
	
	function curmenu:MouseInMenuCenter()
		return (LOCAL_MOUSE.x > self.pos.x + 9 and LOCAL_MOUSE.x < self.pos.x + self.w - 9 and LOCAL_MOUSE.y > self.pos.y - 9 and LOCAL_MOUSE.y < self.pos.y + self.h - 47)
	end
	
	function curmenu:MouseInMenu(x, y, width, height)
		return LOCAL_MOUSE.x > self.pos.x + x and LOCAL_MOUSE.x < self.pos.x + x + width and LOCAL_MOUSE.y > self.pos.y - 36 + y and LOCAL_MOUSE.y < self.pos.y - 36 + y + height
	end
	
	function curmenu:SetPos(x, y)
		self.pos = Vec2(x, y)
		self.point2d.Point = UDim2.new(0, x, 0, y)
	end

	function curmenu:SetActiveTab(tab)
		local drawin = self.drawing
		
		drawin.tab_bar.Position = PointOffset.new(self.point2d, 11 + ((tab - 1) * self.tabsize), 58)
		for k, v in ipairs(drawin.tabs) do
			if k == tab then
				v.background.Visible = false
				v.text.Color = RGB(255, 255, 255)
			else
				v.background.Visible = true
				v.text.Color = RGB(170, 170, 170)
			end
	
			for k1, v1 in ipairs(v.content) do
				v1.Visible = k == tab
			end
		end
		
		for k, v in pairs(self.hitboxes[tab].content) do
			if not v.visible then
				for k1, v1 in pairs(v.drawn) do
					v1.Visible = false
				end
				for k1, v1 in pairs(v.group_drawn) do
					v1.Visible = false
				end
			else
				if v.multigroup then
					if v.active then
						for k1, v1 in pairs(v.drawn) do -- visibility
							v1.Visible = true
						end

						for k1, v1 in ipairs(v.family) do
							if v1 ~= k then
								local familygroup = self.hitboxes[tab].content[v1]

								for k2, v2 in pairs(familygroup.drawn) do
									v2.Visible = false
								end
								familygroup.active = false
							end
						end

						for k1, v1 in pairs(v.props.bar) do
							v1.drawn.Position = PointOffset.new(self.point2d, v.props.barpos.pos, v.props.barpos.old_y + (k1 * 2) - 2)
							v1.drawn.Size = Vector2.new(v.props.barpos.length, 2)
						end

						for k1, v1 in pairs(v.props.nametext) do
							v1.Color = v1.Text == k and RGB(255, 255, 255) or RGB(170, 170, 170)
						end
					end
				end
			end
		end
		self.activetab = tab
	end

