				for element_num, element in ipairs(group_content) do

					if element.type == TOGGLE then
						curgroup_value[element.name] = {
							type = element.type,
							value = element.value,
							unsafe = element.unsafe and true or false,
							drawn = mDraw:Toggle(element.name, element.value, element.unsafe, group_box.relval.x + 8, group_box.relval.y + y_add, drawtab),
							hitbox = {
								x = 8, 
								y = y_add,
								w = 18 + Draw:FontSize("norm", element.name).x,
								h = 12
							}
						}
						y_add += 18
					elseif element.type == SLIDER then
						curgroup_value[element.name] = {
							type = element.type,
							value = element.value,
							stradd = element.stradd or "", 
							minvalue = element.minvalue, 
							maxvalue = element.maxvalue, 
							custom = element.custom or {}, 
							decimal = element.decimal,
							drawn = mDraw:Slider(element.name, element.stradd, element.value, element.minvalue, element.maxvalue, element.custom, element.decimal, group_box.relval.x + 8, group_box.relval.y + y_add, group_box.relval.w - 16, drawtab),
							hitbox = {
								x = 8, 
								y = y_add,
								w = group_box.relval.w - 16,
								h = 22
							}
						}
		
						y_add += 30
					elseif element.type == IMAGE_LAYOUT then
						mDraw.zindex = 10 -- this is so bad
						curgroup_value[element.name] = {
							type = element.type,
							value = element.order[1],
							y_add = y_add,
							hitboxes = mDraw:ImageLayout(element.images, element.order, element.resize, group_box.relval.x + 8, group_box.relval.y + y_add, group_box.relval.w - 16, drawtab),
							event = element.event
						}
						y_add += 30
						mDraw.zindex = group_num + 1
					end
				end
			end
		end
	end

	mDraw.zindex = 1
	curmenu.drawing.tab_bar = mDraw:OutlinedRect(true, Vec2(11 + ((curmenu.activetab - 1) * tabsize), 58), Vec2(tabsize - 2, 2), RGB(35, 35, 35), 255, bbmenu)

	mDraw = nil

	return curmenu
end

